import React from 'react';
import { Bar } from 'react-chartjs-2';
import { Chart, registerables } from 'chart.js';
Chart.register(...registerables);

const CombinedBarChart = ({ dataTables }) => {
  const chartData = {
    labels: dataTables[0].data.map(entry => entry.date),
    datasets: dataTables.map((dataTable, index) => ({
      label: `Total Invocations (Data ${index + 1})`,
      backgroundColor: `rgba(${Math.random() * 255}, ${Math.random() * 255}, ${Math.random() * 255}, 0.6)`,
      data: dataTable.data.map(entry => entry.totalInvocations),
    })),
  };

  const options = {
    indexAxis: 'y',
    plugins: {
      title: {
        display: true,
        text: 'Total Invocations',
        align: 'start',
        padding: {
          top: 10,
          left: 20,
        },
      },
    },
    scales: {
      x: {
        stacked: true,
        beginAtZero: true,
      },
      y: {
        stacked: true,
        ticks: {
          autoSkip: false,
        },
      },
    },
  };

  return (
    <div className="combined-bar-chart">
      <Bar data={chartData} options={options} />
    </div>
  );
};

export default CombinedBarChart;
